decode_msg_empty_success(Bin, TrUserData) ->
    dfp_read_field_def_empty_success(Bin, 0, 0, TrUserData).

dfp_read_field_def_empty_success(<<>>, 0, 0, _) -> #{};
dfp_read_field_def_empty_success(Other, Z1, Z2,
				 TrUserData) ->
    dg_read_field_def_empty_success(Other, Z1, Z2,
				    TrUserData).

dg_read_field_def_empty_success(<<1:1, X:7,
				  Rest/binary>>,
				N, Acc, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_empty_success(Rest, N + 7,
				    X bsl N + Acc, TrUserData);
dg_read_field_def_empty_success(<<0:1, X:7,
				  Rest/binary>>,
				N, Acc, TrUserData) ->
    Key = X bsl N + Acc,
    case Key band 7 of
      0 -> skip_varint_empty_success(Rest, 0, 0, TrUserData);
      1 -> skip_64_empty_success(Rest, 0, 0, TrUserData);
      2 ->
	  skip_length_delimited_empty_success(Rest, 0, 0,
					      TrUserData);
      3 ->
	  skip_group_empty_success(Rest, Key bsr 3, 0,
				   TrUserData);
      5 -> skip_32_empty_success(Rest, 0, 0, TrUserData)
    end;
dg_read_field_def_empty_success(<<>>, 0, 0, _) -> #{}.

skip_varint_empty_success(<<1:1, _:7, Rest/binary>>, Z1,
			  Z2, TrUserData) ->
    skip_varint_empty_success(Rest, Z1, Z2, TrUserData);
skip_varint_empty_success(<<0:1, _:7, Rest/binary>>, Z1,
			  Z2, TrUserData) ->
    dfp_read_field_def_empty_success(Rest, Z1, Z2,
				     TrUserData).

skip_length_delimited_empty_success(<<1:1, X:7,
				      Rest/binary>>,
				    N, Acc, TrUserData)
    when N < 57 ->
    skip_length_delimited_empty_success(Rest, N + 7,
					X bsl N + Acc, TrUserData);
skip_length_delimited_empty_success(<<0:1, X:7,
				      Rest/binary>>,
				    N, Acc, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_empty_success(Rest2, 0, 0,
				     TrUserData).

skip_group_empty_success(Bin, FNum, Z2, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_empty_success(Rest, 0, Z2,
				     TrUserData).

skip_32_empty_success(<<_:32, Rest/binary>>, Z1, Z2,
		      TrUserData) ->
    dfp_read_field_def_empty_success(Rest, Z1, Z2,
				     TrUserData).

skip_64_empty_success(<<_:64, Rest/binary>>, Z1, Z2,
		      TrUserData) ->
    dfp_read_field_def_empty_success(Rest, Z1, Z2,
				     TrUserData).

decode_msg_code_response(Bin, TrUserData) ->
    dfp_read_field_def_code_response(Bin, 0, 0,
				     id('SUCCESS', TrUserData),
				     id(<<>>, TrUserData), TrUserData).

dfp_read_field_def_code_response(<<8, Rest/binary>>, Z1,
				 Z2, F@_1, F@_2, TrUserData) ->
    d_field_code_response_code(Rest, Z1, Z2, F@_1, F@_2,
			       TrUserData);
dfp_read_field_def_code_response(<<18, Rest/binary>>,
				 Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_code_response_message(Rest, Z1, Z2, F@_1, F@_2,
				  TrUserData);
dfp_read_field_def_code_response(<<>>, 0, 0, F@_1, F@_2,
				 _) ->
    #{code => F@_1, message => F@_2};
dfp_read_field_def_code_response(Other, Z1, Z2, F@_1,
				 F@_2, TrUserData) ->
    dg_read_field_def_code_response(Other, Z1, Z2, F@_1,
				    F@_2, TrUserData).

dg_read_field_def_code_response(<<1:1, X:7,
				  Rest/binary>>,
				N, Acc, F@_1, F@_2, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_code_response(Rest, N + 7,
				    X bsl N + Acc, F@_1, F@_2, TrUserData);
dg_read_field_def_code_response(<<0:1, X:7,
