			      N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
			      TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_client_info_proto_name(Rest, 0, 0, F@_1, F@_2,
					 F@_3, F@_4, F@_5, TrUserData);
      18 ->
	  d_field_client_info_proto_ver(Rest, 0, 0, F@_1, F@_2,
					F@_3, F@_4, F@_5, TrUserData);
      26 ->
	  d_field_client_info_clientid(Rest, 0, 0, F@_1, F@_2,
				       F@_3, F@_4, F@_5, TrUserData);
      34 ->
	  d_field_client_info_username(Rest, 0, 0, F@_1, F@_2,
				       F@_3, F@_4, F@_5, TrUserData);
      42 ->
	  d_field_client_info_mountpoint(Rest, 0, 0, F@_1, F@_2,
					 F@_3, F@_4, F@_5, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_client_info(Rest, 0, 0, F@_1, F@_2, F@_3,
					F@_4, F@_5, TrUserData);
	    1 ->
		skip_64_client_info(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				    F@_5, TrUserData);
	    2 ->
		skip_length_delimited_client_info(Rest, 0, 0, F@_1,
						  F@_2, F@_3, F@_4, F@_5,
						  TrUserData);
	    3 ->
		skip_group_client_info(Rest, Key bsr 3, 0, F@_1, F@_2,
				       F@_3, F@_4, F@_5, TrUserData);
	    5 ->
		skip_32_client_info(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				    F@_5, TrUserData)
	  end
    end;
dg_read_field_def_client_info(<<>>, 0, 0, F@_1, F@_2,
			      F@_3, F@_4, F@_5, _) ->
    #{proto_name => F@_1, proto_ver => F@_2,
      clientid => F@_3, username => F@_4, mountpoint => F@_5}.

d_field_client_info_proto_name(<<1:1, X:7,
				 Rest/binary>>,
			       N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_client_info_proto_name(Rest, N + 7,
				   X bsl N + Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
				   TrUserData);
d_field_client_info_proto_name(<<0:1, X:7,
				 Rest/binary>>,
			       N, Acc, _, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bytes:Len/binary, Rest2/binary>> = Rest,
			   {id(binary:copy(Bytes), TrUserData), Rest2}
			 end,
    dfp_read_field_def_client_info(RestF, 0, 0, NewFValue,
				   F@_2, F@_3, F@_4, F@_5, TrUserData).

