	   {_, #{payload := NFpayload}} ->
	       S6#{payload => NFpayload};
	   {#{payload := PFpayload}, _} ->
	       S6#{payload => PFpayload};
	   _ -> S6
	 end,
    case {PMsg, NMsg} of
      {_, #{timestamp := NFtimestamp}} ->
	  S7#{timestamp => NFtimestamp};
      {#{timestamp := PFtimestamp}, _} ->
	  S7#{timestamp => PFtimestamp};
      _ -> S7
    end.


verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      empty_success ->
	  v_msg_empty_success(Msg, [MsgName], TrUserData);
      code_response ->
	  v_msg_code_response(Msg, [MsgName], TrUserData);
      send_bytes_request ->
	  v_msg_send_bytes_request(Msg, [MsgName], TrUserData);
      close_socket_request ->
	  v_msg_close_socket_request(Msg, [MsgName], TrUserData);
      authenticate_request ->
	  v_msg_authenticate_request(Msg, [MsgName], TrUserData);
      timer_request ->
	  v_msg_timer_request(Msg, [MsgName], TrUserData);
      publish_request ->
	  v_msg_publish_request(Msg, [MsgName], TrUserData);
      subscribe_request ->
	  v_msg_subscribe_request(Msg, [MsgName], TrUserData);
      unsubscribe_request ->
	  v_msg_unsubscribe_request(Msg, [MsgName], TrUserData);
      socket_created_request ->
	  v_msg_socket_created_request(Msg, [MsgName],
				       TrUserData);
      received_bytes_request ->
	  v_msg_received_bytes_request(Msg, [MsgName],
				       TrUserData);
      timer_timeout_request ->
	  v_msg_timer_timeout_request(Msg, [MsgName], TrUserData);
      socket_closed_request ->
	  v_msg_socket_closed_request(Msg, [MsgName], TrUserData);
      received_messages_request ->
	  v_msg_received_messages_request(Msg, [MsgName],
					  TrUserData);
      conn_info ->
	  v_msg_conn_info(Msg, [MsgName], TrUserData);
      address -> v_msg_address(Msg, [MsgName], TrUserData);
      certificate_info ->
	  v_msg_certificate_info(Msg, [MsgName], TrUserData);
      client_info ->
	  v_msg_client_info(Msg, [MsgName], TrUserData);
      message -> v_msg_message(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


