      _ -> ok
    end,
    case M of
      #{payload := F6} ->
	  v_type_bytes(F6, [payload | Path], TrUserData);
      _ -> ok
    end,
    case M of
      #{timestamp := F7} ->
	  v_type_uint64(F7, [timestamp | Path], TrUserData);
      _ -> ok
    end,
    lists:foreach(fun (node) -> ok;
		      (id) -> ok;
		      (qos) -> ok;
		      (from) -> ok;
		      (topic) -> ok;
		      (payload) -> ok;
		      (timestamp) -> ok;
		      (OtherKey) ->
			  mk_type_error({extraneous_key, OtherKey}, M, Path)
		  end,
		  maps:keys(M)),
